document.addEventListener("DOMContentLoaded",(()=>{const e=document.querySelector(".btnMnu"),t=document.querySelector(".mobileMenu"),c=document.querySelector(".closeMobileMenu");e.addEventListener("click",(c=>{e.classList.toggle("active"),t.classList.toggle("active")})),c.addEventListener("click",(c=>{e.classList.remove("active"),t.classList.remove("active")}))}));